package vo;

public class CommentVo {
	
	int    t_idx;
	String t_content;
	String t_ip;
	String t_regdate;
	int    m_idx;
	String m_name;
	int    r_idx;
	int    no;
	
	public CommentVo() {
		// TODO Auto-generated constructor stub
	}

	public int getT_idx() {
		return t_idx;
	}

	public void setT_idx(int t_idx) {
		this.t_idx = t_idx;
	}

	public String getT_content() {
		return t_content;
	}

	public void setT_content(String t_content) {
		this.t_content = t_content;
	}

	public String getT_ip() {
		return t_ip;
	}

	public void setT_ip(String t_ip) {
		this.t_ip = t_ip;
	}

	public String getT_regdate() {
		return t_regdate;
	}

	public void setT_regdate(String t_regdate) {
		this.t_regdate = t_regdate;
	}

	public int getM_idx() {
		return m_idx;
	}

	public void setM_idx(int m_idx) {
		this.m_idx = m_idx;
	}

	public String getM_name() {
		return m_name;
	}

	public void setM_name(String m_name) {
		this.m_name = m_name;
	}

	public int getR_idx() {
		return r_idx;
	}

	public void setR_idx(int r_idx) {
		this.r_idx = r_idx;
	}

	public int getNo() {
		return no;
	}

	public void setNo(int no) {
		this.no = no;
	}
	
	
	
}
